import React from 'react';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import Login from '../Login/Login';


function App() {
    return(
        <>
        <div className="App">
            <Header />
            <Login />
            <Footer />
        </div>
        </>
    )
}

export default App;
